import React from 'react';
import styles from './logo.module.css';
import logo from '../../Images/Logo.png';

function Logo() {
  return (
    <div className={styles.logo}>
      <img 
        src={logo} 
        alt="logo"
        className='logo-img'>
  
        </img>

      <p className='logo-text'><strong>B</strong>ooks</p>
    </div>
  );
}

export default Logo;
